import styled from 'styled-components';

export const Container = styled.div`
    margin-left: auto;
    margin-top:150px;
    margin-right: auto;
    background: #1C1C1C;
    border-radius:4px;
    max-width: 800px;
    width: 100%;
    height: 400px;
    padding: 10px;
    box-shadow: 0px 0px 30px #000;

    .titulo {
        margin-top: 0px ;
        color: #fff;
    }

    .descricao {
        color: #fff;
    }
`
